import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { NavigationContainer } from '@react-navigation/native';

import index from '../screens/index';
import aboutUs from '../screens/about_us';

import indoors_list from '../screens/lists/indoor_gyms_list';
import outdoors_list from '../screens/lists/outdoor_spots_list';
import events_list from '../screens/lists/events_list';
import ices_list from '../screens/lists/ice_spots_list';
import mountain_routes_list from '../screens/lists/mountain_routes_list';
import other_activities_list from '../screens/lists/other_activities_list';

const Stack = createNativeStackNavigator();

export const Navigation = () => {
    return (
        <NavigationContainer>
            <Stack.Navigator>
                <Stack.Screen name="index" component={index} options={{ title: 'Climbing In Geourgia' }}/>
                <Stack.Screen name="aboutUs" component={aboutUs} options={{ title: 'About Us' }}/>

                <Stack.Screen name="indoors_list" component={indoors_list} options={{ title: 'Indoor Climbing Gyms' }}/>
                <Stack.Screen name="outdoors_list" component={outdoors_list} options={{ title: 'Outdoor Spots' }}/>
                <Stack.Screen name="events_list" component={events_list} options={{ title: 'Events' }}/>
                <Stack.Screen name="ices_list" component={ices_list} options={{ title: 'Ice & Mix Climbing Spots' }}/>
                <Stack.Screen name="mountain_routes_list" component={mountain_routes_list} options={{ title: 'Mountaineering Routes' }}/>
                <Stack.Screen name="other_activities_list" component={other_activities_list} options={{ title: 'Other Actyvity' }}/>
            </Stack.Navigator>
        </NavigationContainer>
    );
}
